import React from "react";

const Test = () => {
  const handleClick = () => {
    const userInfo = {
      email: "email@email.com",
      password: "1234",
    };
    localStorage.setItem("user", JSON.stringify(userInfo));
  };
  return (
    <div>
      <button onClick={handleClick}>localstorage</button>
    </div>
  );
};

export default Test;
